GM_addStyle(`
    div[id^="anya-"] > svg, div[id^="anya-"] > div {
        filter:drop-shadow(0 0 4px #00000025)
    }
    .anya-close {
        position:absolute;
        top:0;
        right:0;
        width:16px;
        height:16px;
        background:url('data:image/svg+xml;base64,');
        cursor:pointer
    }
    .anya-resize {
        position:absolute;
        bottom:0;
        right:0;
        width:16px;
        height:16px;
        background:url('data:image/svg+xml;base64,');
        cursor:se-resize
    }
    .anya-rotate {
        position:absolute;
        top:0;
        left:0;
        width:16px;
        height:16px;
        background:url('data:image/svg+xml;base64,');
        cursor:url('data:image/svg+xml;base64,'), ns-resize
    }
    .anya-dark .anya-close, .anya-dark .anya-resize, .anya-dark .anya-rotate {
        filter:invert(1)
    }
    .prevent-select {
        -webkit-user-select:none;
        -moz-user-select:none;
        -ms-user-select:none;
        user-select:none
    }
`);

